function replaceUndefined(vl){
  if(typeof(vl) === "undefined"){
      return "---"; // return 0 as replace, and end function execution
  } 
  if(vl > 999999 || vl < 0.0009) {
    return vl.toExponential();
  }
  return vl; // the above state was false, functions continues and return original value
};

